import { TextInput } from "./TextInput"

export const Transform = ({ old, object, name }) => {
  return <div>
    Transform
    <div>
      Position
      <TextInput
        text="x"
        parent={object.transform.position}
        access={`x`}
        toNumber={true}
      />
      <TextInput
        text="y"
        parent={object.transform.position}
        access={`y`}
        toNumber={true}
      />
    </div>
    <div>
      Rotation
      <TextInput
        text="z"
        parent={object.transform.rotation}
        access={`z`}
        toNumber={true}
      />
      Rotation
      <TextInput
        text="test"
        parent={object.transform.rotation}
        access={`z`}
        toNumber={true}
      />
    </div>
    <div>
      Scale
      <div>
        x
      </div>
      <div>
        y
      </div>
    </div>
  </div>
}
